import logo from './logo.svg';
import './App.css';
import ReactHlsPlayer from 'react-hls-player';

function App() {
  return (
    <html>
      <div className="App">
        <header className="App-header">
          <h1 className='Player-Name'>Spotify Webplayer</h1>
          <video id='video' controls autoPlay>Could not locate file</video>
        </header>
      </div>
    </html>
  );
}

function Hls() {
  return (
    <script>
      var video = document.getElementById('video');
    </script>
  )
}

export default App;
